package com.example.service;

import java.time.LocalDate;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.Iterator;
import java.util.List;
import java.util.Map;
import java.util.UUID;

import com.example.entite.Collegue;

/**
 * @author Cécile Peyras
 *
 */
public class CollegueService {

	
	 private Map<String, Collegue> data = new HashMap<>();

	    public CollegueService() {
	        // TODO alimenter data avec des données fictives
	        // Pour générer un matricule : `UUID.randomUUID().toString()`
	    	
	    	Collegue collegue1 = new Collegue(UUID.randomUUID().toString(), "Peyras", "Cecile", "cecile@collegue.fr",LocalDate.of(1981, 7, 15), "data:image/jpeg;base64,"); 
	    	Collegue collegue2 = new Collegue(UUID.randomUUID().toString(),"Kiyende", "Marley", "marley@collegue.fr", LocalDate.of(2007, 9, 15), "data:image/jpeg;base64,"); 
	    	Collegue collegue3 = new Collegue(UUID.randomUUID().toString(), "Libata", "Evan", "evan@collegue.fr", LocalDate.of(2011, 6, 15), "data:image/jpeg;base64,"); 

	    	
	    	data.put(collegue1.getMatricule(), collegue1); 
	    	data.put(collegue2.getMatricule(), collegue2); 
	    	data.put(collegue3.getMatricule(), collegue3); 
	    }

	    public List<Collegue> rechercherParNom(String nomRecherche) {

	        // TODO retourner une liste de collègues dont le nom est fourni
	    	
	    	List<Collegue> listeCollegue = new ArrayList<>(); 
	    	
	    	
	    	Iterator<Collegue> iterator = data.values().iterator(); 
	    	
	    	while (iterator.hasNext()) {
	    		Collegue collegue = iterator.next(); 
	    		if(collegue.getNom().equals(nomRecherche)) {
	    			listeCollegue.add(collegue); 
	    		}
	    	}
	    	
	    	
			return listeCollegue;
	    }



}
